import { BrowserRouter, Route, Link } from 'react-router-dom';
import UserSignUp from './userSignup'

class UserLogin extends Component {
    render() {
        return (
            <BrowserRouter>
                <div>
                    <Link to="/andsign"> User Signup</Link>
                    <h1>heyy</h1>
                    <p>this is login</p>
                </div>
            </BrowserRouter>
        )
    }
}
export default UserLogin;
